Secret chats are accepted or refused automatically, based on a value in the settings (by default MadelineProto is set to accept all secret chats).
Before sending any message, you must check if the secret chat was accepted by the other client with the following method:
$status is 0 if the chat cannot be found in the local database, 1 if the chat was requested but not yet accepted, and 2 if it is a new secret chat.
If the chat is accepted, you can proceed to send the message.
In the following code, the "send_message" method checks the current status of the secret chat before sending the message.
$status = $client->send_message($from, $to, $message);
if ($status == 0) {
// Message was sent to the client
} else {
// Secret chat was not accepted, message cannot be sent
}
